VALUES ('26014722', 'Cordon bleu et coquiettes', 'Coquillettes cuites 42,8% (eau, semoule de blé dur, huile de colza), cordon bleu de dinde 35,7% [viande de dinde traitée en salaison, au jambon de dinde et au fromage fondu, pannée et cuite (viande de dinde traitée en salaison 19,6% (viande de dinde 11% (origine : UE), peaux de volaille, eau, fibres de bambou, dextrose, sel), panure 8,9% (farine de blé, eau, sel, levures, épices : paprika et curcuma), jambon de dinde goût fumé 3,6% (viande rouge de dinde 2,3% (origine : UE), eau, amidon de maïs, dextrose, sel, arôme de fumée, stabilisants : diphosphates et triphosphates, conservateur : nitrite de sodium), fromage fondu 3,6% (fromage, beurre, eau, protéines de lait, poudre de lait écrémé, sels émulsifiants : polyphosphates, diphosphates, citrates de sodium, phosphates de calcium et phosphates de sodium, poudre de lactosérum (contient du lait), sel, épaississant : carraghénanes, amidon transformé de pomme de terre, acidifiant : acide citrique), huile de tournesol)], eau, crème fraîche, emmental, amidon transformé de maïs, sel, épaississant : gomme xanthane, arome naturel de muscade et autres épices, poivre. Traces éventuelles de poissons, crustacés, mollusques, oeuf, soja, céleri, moutarde.', 'https://static.openfoodfacts.org/images/products/26014722/front_fr.41.400.jpg', '10', '3.7', '16', '1', '', '7.3', '0.8', '0.31496062992126', '', '1');

